function calculateDominicanPayroll(t){if("number"!=typeof t)return null;const e={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},r={threshold:72260.25,rate:.25,fixedAmount:6648},h=.0304*t,l=.0287*t,n=t-(h+l);let s=0;if(n>=r.threshold){const t=n-r.threshold;s=r.fixedAmount+t*r.rate}else if(n<r.threshold&&n>=o.threshold){const t=n-o.threshold;s=o.fixedAmount+t*o.rate}else if(n<o.threshold&&n>=e.threshold){const t=n-e.threshold;s=e.fixedAmount+t*e.rate}return{monthlySalary:t,netMonthlySalary:n-s,sfs:h,afp:l,isr:s,deductions:h+l+s}}